import React from "react";

function Enlace() {
  return (
    <a
      href="https://reactjs.org"
      target="_blank"
      rel="noopener noreferrer"
      className="btn btn-primary"
    >
      Visita la documentación de React
    </a>
  );
}

export default Enlace;
